css:
.d2h-code-linenumber {
  position: relative !important;
}
.d2h-code-line {
  padding: 0 8em 0 0 !important;
}
div.simple-git.history {
  color: #9da1b4;
  font-size: 14px;
}
div.simple-git.history div.row {
  display: flex;
  justify-content: flex-start;
  margin-bottom: 0.5em;
  align-items: center;
  flex-wrap: wrap;
}
div.simple-git.history div.row div {
  margin-right: 0.7em;
}
div.simple-git.history div.row div:nth-child(2) {
  font-style: italic;
}
div.simple-git.history div.row div:nth-child(4) {
  font-weight: bold;
}
div.simple-git.diff-view {
  font-size: 14px !important;
  width: 100%;
}
div.simple-git.diff-view .d2h-diff-table {
  font-size: 14px !important;
}
div.simple-git.blame {
  display: flex;
  background: #2d303b;
  border-top: solid 1px;
  border-color: #63687e;
  color: #dee3f7;
}
div.simple-git.blame div {
  margin-left: 1em;
}
div.simple-git.blame div:nth-child(3) {
  font-style: italic;
}
